export default function App(props){
    let result="";

    props.map((prop)=>{
        result+="<h1>"+prop.name+"</h1><h3>"+prop.age+"</h3><h6>"+prop.gen+"</h6>";
    })
    return(
        <div>
            {result}
        </div>
    )
}
